import React from 'react';
import styles from './Header.module.css';
import { Logo, BurgerIcon, ListIcon, ProfileIcon } from '@ya.praktikum/react-developer-burger-ui-components'
import NavButton from "../NavButton/NavButton";


const Header = () => {
    const [current, setCurrent] = React.useState('one');

    return (
        <header className={styles.header}>
            <div className={`${styles.header__container} pt-4 pb-4`}>
                <div className={styles.header__nav}>
                    <NavButton value="one" active={current === 'one'} icon={<BurgerIcon type="secondary" />} text="Конструктор" onClick={setCurrent}/>
                    <NavButton value="two" active={current === 'two'} icon={<ListIcon type="secondary" />} text="Лента заказов" onClick={setCurrent}/>
                </div>
                <div className={styles.logo}>
                    <Logo/>
                </div>
                <NavButton value="three" active={current === 'three'} icon={<ProfileIcon type="secondary" />} text="Личный кабинет" onClick={setCurrent}/>
            </div>
        </header>
    );
};

export default Header;
